import React from 'react'
import './App.css'
import Container from 'react-bootstrap/Container'
import HomePage from './pages/HomePage'

class App extends React.Component {
  state = {
    users: [],
    isLoading: true
  }

  render(){
    return (
      <Container>
        <HomePage />
      </Container>
    )
  }
}

export default App;
